description:
Week 23 of TEMPLATE, a new digital comics series from QAM Comics. Fans of Thrillbent, Monkeybrain, or DC Digital First style comics should definitely check it out. 


Want a print copy of Volume 1 when we finish our webcomic run on November 27? Our Kickstarter campaign has two weeks left:

 &lt;a href=&quot;
http://www.kickstarter.com/projects/qmiles/template-a-cyberpunk-action-thriller&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.kickstarter.com/projects/qmiles/template-a-cyberpunk-action-thriller&lt;/a&gt;


Our final stretch goal for this campaign is actually locking in production on TEMPLATE, Volume 2, so if you've liked the story and want to see more let us know by pledging!


Thanks!


Q
